import React from 'react'

const Industry = () => {
    return (
        <div>
            <h1 className="mt-5 text-center mt-5 font-weight-bold">Industries we Served</h1>
            <div className="container">
                <img src="https://digitaloid.co/wp-content/uploads/2020/06/services-01-1536x458.png" />
            </div>

        </div>
    )
}

export default Industry;
